import React from "react";
import Badge from "../Badge/Badge";
import "./Project.scss";
import "../Button/Button.scss";

export default function Project({ data }) {
  return (
    <article className="project">
      <div
        aria-hidden="true"
        className="container--background"
        style={{
          backgroundImage: `url(http://localhost:1337${data.image.data.attributes.url})`,
        }}
      ></div>

      <h3 className="project__title">{data.title}</h3>
      <p className="project__description">{data.description}</p>
      <div className="project__links">
        <a
          href={data.githubUrl}
          className="link__github"
          aria-label="Github Repo"
        >
          Github
        </a>
        <a href={data.liveUrl} className="link__live" aria-label="Live Site">
          Live Site
        </a>
      </div>
      <div className="project__badges">
        {data.badges.data.map((badge, i) => (
          <Badge key={i}>{badge.attributes.badge}</Badge>
        ))}
      </div>
    </article>
  );
}
